INSERT INTO ascendco.trays_per_hour (            hsys_name,            assemble_day_name,            user_name,            facility_name,            assemble_date,            hours_assembly,            inst_per_hour,            trays_per_hour,            trays_assembled,            assemble_day_of_week,            inst_assembled,            hsys_id,            user_id,            facility_id)      SELECT              expanded_data."HsysName",             expanded_data."Assemble_DayName",             expanded_data."UserName",             expanded_data."FacilityName",             expanded_data."Assemble_Date",             expanded_data."HoursAssembly",             expanded_data."InstPerHour",             expanded_data."TraysPerHour",             expanded_data."TraysAssembled",             expanded_data."Assemble_DayOfWeek",             expanded_data."InstAssembled",             expanded_data."HsysID",             expanded_data."UserID",             expanded_data."FacilityID"        FROM domo_passthrough  CROSS JOIN jsonb_to_recordset(domo_passthrough.data) as expanded_data (             "HsysName" citext,             "Assemble_DayName" citext,             "UserName" citext,             "FacilityName" citext,             "Assemble_Date" date,             "HoursAssembly" float8,             "InstPerHour" float8,             "TraysPerHour" float8,             "TraysAssembled" int4,             "Assemble_DayOfWeek" int4,             "InstAssembled" int4,             "HsysID" uuid,             "UserID" uuid,             "FacilityID" uuid)       WHERE dataset_name = 'TraysPerHour_PG' AND             view_version = '1'